// ResumeFormProject.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ResumeFormProject({ resumeId }) {
  const [projectTitle, setProjectTitle] = useState('');
  const [projectContent, setProjectContent] = useState('');
  const [projectPeriod, setProjectPeriod] = useState('');
  const [isCurrent, setIsCurrent] = useState(false);
  const [projects, setProjects] = useState([]);

  useEffect(() => {
    fetchProjects();
  }, [resumeId]);

  const fetchProjects = async () => {
    try {
      const response = await axios.get(`/api/resumes/${resumeId}/projects`);
      setProjects(response.data);
    } catch (error) {
      console.error('Error fetching projects:', error);
    }
  };

  const handleProjectSubmit = async () => {
    try {
      await axios.post(`/api/resumes/${resumeId}/projects`, {
        project_title: projectTitle,
        project_content: projectContent,
        project_period: projectPeriod,
        is_current: isCurrent
      });
      // Clear input fields after successful submission
      setProjectTitle('');
      setProjectContent('');
      setProjectPeriod('');
      setIsCurrent(false);
      // Refetch projects to update the list immediately
      fetchProjects();
    } catch (error) {
      console.error('Error submitting project:', error);
    }
  };

  const handleDeleteProject = async (id) => {
    try {
      await axios.delete(`/api/resumes/${resumeId}/projects/${id}`);
      // Refetch projects to update the list immediately
      fetchProjects();
    } catch (error) {
      console.error('Error deleting project:', error);
    }
  };

  return (
    <div style={{ textAlign: 'center' }}>
      <h2>Add New Project</h2>
      <div>
        <label>
          Project Title:
          <input type="text" value={projectTitle} onChange={(e) => setProjectTitle(e.target.value)} />
        </label>
      </div>
      <div>
        <label>
          Project Content:
          <textarea value={projectContent} onChange={(e) => setProjectContent(e.target.value)} />
        </label>
      </div>
      <div>
        <label>
          Project Period:
          <input type="text" value={projectPeriod} onChange={(e) => setProjectPeriod(e.target.value)} />
        </label>
      </div>
      <div>
        <label>
          Is Current:
          <input type="checkbox" checked={isCurrent} onChange={(e) => setIsCurrent(e.target.checked)} />
        </label>
      </div>
      <button onClick={handleProjectSubmit}>Submit</button>
      <h2>Projects</h2>
      <ul>
        {projects.map((project) => (
          <li key={project.id}>
            <div>
              <strong>Project Title:</strong> {project.project_title}
            </div>
            <div>
              <strong>Project Content:</strong> {project.project_content}
            </div>
            <div>
              <strong>Project Period:</strong> {project.project_period}
            </div>
            <div>
              <strong>Is Current:</strong> {project.is_current ? 'Yes' : 'No'}
            </div>
            <button onClick={() => handleDeleteProject(project.id)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ResumeFormProject;
